CREATE TABLE `bond_underwriter_map` (
  `id` BIGINT(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '数据表主键（自增ID）',
  `bond_key` VARCHAR(32) NOT NULL COMMENT '债券bondkey',
  `underwriter_id` VARCHAR(32) NOT NULL COMMENT '承销商id',
  `underwriting_role` VARCHAR(64) DEFAULT '' COMMENT '承销角色：独家主承，副主承，联席主承，牵头主承，主承销商/薄记管理人',
  `create_date` DATETIME DEFAULT CURRENT_TIMESTAMP COMMENT '数据创建时间',
  `modify_date` DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '数据更新时间',
  PRIMARY KEY (`id`),
  KEY `select_key1` (`underwriter_id`,`bond_key`,`modify_date`)
) ENGINE=INNODB AUTO_INCREMENT=105476 DEFAULT CHARSET=utf8 COMMENT='债券承销关系映射表';

